import React from "react";
import {Col } from "react-bootstrap";

const ColGroup = (props) => (
  <Col className="my-4" sm={5}>
    <h5>{props.title}</h5>
    <ul className="no-bullet">{props.children}</ul>
  </Col>
);

export default ColGroup;
